import { useState } from "react"
import "./generator.scss"

const Generator = ()=>{
    const [blur, setBlur] = useState(20);
    const [transparency, setTransparency] = useState(100);

    const blurHandle=(e:any)=>{
        setBlur(e.target.value)
    }
    const transHandle=(e:any)=>{
        setTransparency(e.target.value)
    }
    return(
        <div className="g-background">
            <div className="control-panels">
                <div className="blur-control">
                    <label htmlFor="blur">
                        <span>Blur:</span>
                        <span>{blur}</span>
                    </label>
                    <input type={"range"} id="blur" step={0.5} min="0" max="20" onChange={blurHandle}></input>
                </div>
                <div className="blur-control">
                <label htmlFor="transparency">
                        <span>Transparency:</span>
                        <span>{transparency}</span>
                    </label>
                    <input type={"range"} id="transparency" step={0.5} min="0" max="100" onChange={transHandle}></input>
                </div>
            </div>
        </div>
    )
}
export default Generator
